import "./App.css";

function App() {
	return (
		<div className="app">
			<div className="snake">
				<div className="snake__dot" style={{ top: 0, left: 0 }}></div>
				<div className="snake__dot" style={{ top: 0, left: "2%" }}></div>
				<div className="snake__dot" style={{ top: 0, left: "%" }}></div>
			</div>
		</div>
	);
}

export default App;
